class Stack{#t=[];constructor(){}push(t){this.#t.push(t)}pop(){return this.#t.length>0?this.#t.pop():void 0}clear(){this.#t=[]}get peek(){return this.#t[this.#t.length-1]}get length(){return this.#t.length}get lastIndex(){return this.#t.length-1}values(){return[...this.#t]}contains(t){return this.#t.includes(t)}get isEmpty(){return 0===this.#t.length}display(){console.log(`Stack (${this.#t.length}) {\n ${this.#t.join(", ")}\n}`)}}